import React from 'react';
import { NavLink } from 'react-router-dom';
import Synchfour from './Synchfour';
const Navbar=()=>{
    return(
        <>
        <div>
            <NavLink className="nav_link" to="/">Synch 4-bit</NavLink>
            <NavLink className="nav_link" to="/synchtwo">Synch 2-bit</NavLink>
        </div>
        </>
    );
};
export default Navbar;
